import React, { useState, useEffect } from "react";
import teamPic from "../assets/teampic.jpg"
import bearLogo from "../assets/bearLogo.png"

const NavBar = ({ match  }) => {
    return ( 
        <>
    <div className="fixed w-full bg-gray-300 border-b-2 border-black h-16  z-10">
       <div className="flex flex-inline">
       <img src={bearLogo} className="w-16 h-16 ml-8"></img>
           <p className="my-auto text-3xl font-bold text-red-900">Bears Hockey</p>

           </div> 
           <div className="text-right relative ">
               <span className="text-right">Home</span>
               <span>About</span>


           </div>
    </div>
        </>
    )

}
export default NavBar;
